import React from "react";
import * as ReactDOMClient from 'react-dom/client';
import App from "./App"

const app = ReactDOMClient.createRoot(document.getElementById("app"))

fetch
('https://jsonplaceholder.typicode.com/posts'
).then((data) => {
    if(data.status === 200){
        return data.json();
    }
    else {
        console.error("ceva nu e ok")
    }
    console.log(data)
}).then((info) => {
    console.log(info)
})

app.render(<App />)
